import React from "react";
import styled from "styled-components";
import ViewTable from "../blocks/viewTable";
import { rows, mockData } from "../data";

const Container = styled.div`
  width: 100%;
  height: 100%;
  padding: 10px;
`;

const Home = () => {
  return (
    <Container>
      <ViewTable rows={rows} />
    </Container>
  );
};

export default Home;
